webpackJsonp([0xa10bee8c8a5a],{"./node_modules/json-loader/index.js!./.cache/json/pagina-ejemplo.json":function(e,a){e.exports={data:{wordpressPage:{title:"Página de ejemplo",content:'<p>Esta es una página de ejemplo, Es diferente a una entrada de un blog porque se mantiene estática y se mostrará en la barra de navegación (en la mayoría de temas). Casi todo el mundo comienza con una página Sobre mí para presentarse a los potenciales visitantes. Podría ser algo así: </p>\n<blockquote><p>¡Hola!: Soy mensajero por el día, aspirante a actor por la noche y esta es mi web. Vivo en Madrid, tengo perrazo llamado Juan y me encantan las piñas coladas (y que me pille un chaparrón)</p></blockquote>\n<p> … o algo así: </p>\n<blockquote><p>La empresa Calcetines XYZ se fundó en 1971, y ha estado produciendo calcetines de calidad para sus clientes desde entonces. Ubicada en Gothan, la empresa XYZ tiene más de 2.000 empleados e intenta ayudar en lo que puede para mejorar la vida en Gothan</p></blockquote>\n<p> Si eres nuevo en WordPress deberías ir a <a href="http://dev-goncy-wordpress-gatsby.pantheonsite.io/wp-admin/">tu escritorio</a> para borrar esta página y crear algunas nuevas con tu contenido. ¡Pásalo bien!</p>\n',date:"October 05, 2017"},site:{id:"Site",siteMetadata:{title:"A sample site using gatsby-source-wordpress",subtitle:"Data fetched from a site hosted on wordpress.com"}}},pathContext:{id:"af3867e7-71f9-5166-95f5-20e2defbd19c"}}}});
